script: |
  super -f tsv -I q98.sql | sort > q98.out

vector: true

inputs:
  - name: q98.sql
    data: |
      SELECT DISTINCT - 96 + + COUNT ( * ) AS col1 FROM tab1 AS cor0 WHERE NOT NULL <= + col0 * + - col0 * + ( + + ( - col0 ) );
  - name: tab1

outputs:
  - name: q98.out
    data: |
      -96
